  `deleted` tinyint(1) DEFAULT '0',
  `status_id` int(10) unsigned DEFAULT NULL,
  `contract_service_additional_cost_id` int(10) unsigned DEFAULT NULL,
  `ballance` double DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `FK_predicted_income_expenses_1` (`invoicerequirement_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

