--
-- Definition of procedure `BANKSAGENCIESsp_get_by_bank_id`
--

DROP PROCEDURE IF EXISTS `BANKSAGENCIESsp_get_by_bank_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `BANKSAGENCIESsp_get_by_bank_id`(_BANK_ID INT)
BEGIN
        DECLARE _TMP INT;
        SET _TMP = (SELECT COUNT(*) FROM BANKSAGENCIES
        WHERE BANK_ID = _BANK_ID);

        IF _TMP IS NULL OR _TMP=0 THEN
                SELECT -1 ID, '' NAME, '' DETAILS FROM BANKSAGENCIES LIMIT 1;
        ELSE
                SELECT * FROM BANKSAGENCIES
                WHERE BANK_ID = _BANK_ID
                ORDER BY NAME;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

