CREATE DEFINER=`root`@`localhost` PROCEDURE `BANKSAGENCIESsp_get_id_by_name`(
        _NAME VARCHAR(250),
        _BANK_NAME VARCHAR(250)
)
BEGIN
        SELECT BA.ID FROM BANKSAGENCIES BA
        INNER JOIN BANKS B ON BA.BANK_ID = B.ID
        WHERE BA.NAME = _NAME AND B.NAME = _BANK_NAME;
END $$
