DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `BANK_RECEIPTSsp_get_by_amount_date_description`(
        _AMOUNT DOUBLE,
        _DATA_TRANZACTIEI DATE,
        _DESCRIPTION_SEQUENCE TEXT
)
BEGIN
        SELECT * FROM BANK_RECEIPTS WHERE AMOUNT_PAID = _AMOUNT AND
                DATE = _DATA_TRANZACTIEI AND
                DESCRIPTION LIKE CONCAT('%', _DESCRIPTION_SEQUENCE, '%') LIMIT 1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `BANK_RECEIPTSsp_insert`
--

DROP PROCEDURE IF EXISTS `BANK_RECEIPTSsp_insert`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `BANK_RECEIPTSsp_insert`(
        _EXTRACT_NUMBER VARCHAR(100),
        _EXTRACT_DATE DATE,
        _DATE DATE,
        _INVOICE_ID INT,
        _AMOUNT_PAID DOUBLE,
        _DESCRIPTION TEXT,
        _OWNER_ID INT,
        _PROPERTY_ID INT
)
BEGIN
        IF NOT EXISTS (SELECT ID FROM BANK_RECEIPTS WHERE OWNER_ID = _OWNER_ID AND PROPERTY_ID = _PROPERTY_ID AND INVOICE_ID = _INVOICE_ID AND DATE = _DATE) THEN
                BEGIN
                INSERT INTO BANK_RECEIPTS SET
                EXTRACT_NUMBER = _EXTRACT_NUMBER,
                EXTRACT_DATE = _EXTRACT_DATE,
                DATE = _DATE,
                INVOICE_ID = _INVOICE_ID,
                AMOUNT_PAID = _AMOUNT_PAID,
                DESCRIPTION = _DESCRIPTION,
                OWNER_ID = _OWNER_ID,
                PROPERTY_ID = _PROPERTY_ID;

                SELECT * FROM BANK_RECEIPTS WHERE ID = LAST_INSERT_ID();
                END;
         END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CASH_RECEIPTSsp_delete`
--

DROP PROCEDURE IF EXISTS `CASH_RECEIPTSsp_delete`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CASH_RECEIPTSsp_delete`(_ID INT)
BEGIN

        DECLARE _AMOUNT DOUBLE;
        DECLARE _AMOUNT_PAID_RON DOUBLE;
        DECLARE _STATUS_ID INT;
        DECLARE _BALLANCE DOUBLE;
        DECLARE _PIE_CURRENCY VARCHAR(4);
        DECLARE _PIE_AMOUNT DOUBLE;
        DECLARE _PIE_AMOUNT_TOTAL DOUBLE;
        DECLARE _PIE_ID INT;
        DECLARE _EXCHANGE_RATE DOUBLE;
        DECLARE done INT DEFAULT FALSE;

        DECLARE cur1 CURSOR FOR
                SELECT PIE.ID, PIE.CURRENCY, PIE.BALLANCE, PIE.AMOUNT FROM INCOME_EXPENSES PIE
                        -- INNER JOIN INVOICEREQUIREMENTS IR ON PIE.INVOICEREQUIREMENT_ID = IR.ID
                        -- INNER JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
                        -- INNER JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
                        -- INNER JOIN INVOICES I ON IRO.INVOICE_ID = I.ID
                        -- INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        INNER JOIN INVOICES I ON PIE.INVOICE_ID = I.ID
                        INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        WHERE CR.ID = _ID;

        DECLARE cur2 CURSOR FOR
                SELECT PIE.ID, PIE.CURRENCY, PIE.BALLANCE, PIE.AMOUNT FROM COMPANY_INCOME_EXPENSES PIE
                        -- INNER JOIN INVOICEREQUIREMENTS IR ON PIE.INVOICEREQUIREMENT_ID = IR.ID
                        -- INNER JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
                        -- INNER JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
                        -- INNER JOIN INVOICES I ON IRO.INVOICE_ID = I.ID
                        -- INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        INNER JOIN INVOICES I ON PIE.INVOICE_ID = I.ID
                        INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        WHERE CR.ID = _ID;


        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

        SET _AMOUNT = (SELECT IFNULL(AMOUNT_PAID_RON,0) FROM CASH_RECEIPTS WHERE ID = _ID);

        OPEN cur1;
        read_loop: LOOP
        FETCH cur1 INTO _PIE_ID, _PIE_CURRENCY, _BALLANCE, _PIE_AMOUNT;
        IF done THEN
                LEAVE read_loop;
        END IF;

        SET _EXCHANGE_RATE = (SELECT IF(MULTIPLIER != NULL, RATE/MULTIPLIER, RATE) RATE
        FROM CURRENCIES WHERE DATE =
        (SELECT MAX(DATE) DATE FROM CURRENCIES WHERE DATE <= (SELECT DATE FROM CASH_RECEIPTS WHERE ID = _ID)) AND
        CURRENCY = _PIE_CURRENCY);

        IF IFNULL(_BALLANCE,0) + ROUND(_AMOUNT / IFNULL(_EXCHANGE_RATE,1) / 1.24, 2) < _PIE_AMOUNT THEN
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'partially paid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'));
        ELSE
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'invoiced' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'));
        END IF;
        UPDATE INCOME_EXPENSES SET
                BALLANCE = IFNULL(BALLANCE,0) + ROUND(_AMOUNT / IFNULL(_EXCHANGE_RATE,1) / 1.24, 2),
                STATUS_ID = _STATUS_ID
                WHERE ID = _PIE_ID;
                /*
                WHERE INVOICEREQUIREMENT_ID = (SELECT IR.ID FROM INVOICEREQUIREMENTS IR
                        INNER JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
                        INNER JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
                        INNER JOIN INVOICES I ON IRO.INVOICE_ID = I.ID
                        INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        WHERE CR.ID = _ID);
                */
        SET _PIE_AMOUNT_TOTAL = _PIE_AMOUNT_TOTAL + _PIE_AMOUNT;
        END LOOP;
        CLOSE cur1;


         SET done = FALSE;
        OPEN cur2;
        read_loop: LOOP
        FETCH cur2 INTO _PIE_ID, _PIE_CURRENCY, _BALLANCE, _PIE_AMOUNT;
        IF done THEN
                LEAVE read_loop;
        END IF;

        SET _EXCHANGE_RATE = (SELECT IF(MULTIPLIER != NULL, RATE/MULTIPLIER, RATE) RATE
        FROM CURRENCIES WHERE DATE =
        (SELECT MAX(DATE) DATE FROM CURRENCIES WHERE DATE <= (SELECT DATE FROM CASH_RECEIPTS WHERE ID = _ID)) AND
        CURRENCY = _PIE_CURRENCY);

        IF IFNULL(_BALLANCE,0) + ROUND(_AMOUNT / IFNULL(_EXCHANGE_RATE,1) / 1.24, 2) < _PIE_AMOUNT THEN
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'partially paid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'));
        ELSE
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'invoiced' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'));
        END IF;
        UPDATE COMPANY_INCOME_EXPENSES SET
                BALLANCE = IFNULL(BALLANCE,0) + ROUND(_AMOUNT / IFNULL(_EXCHANGE_RATE,1) / 1.24, 2),
                STATUS_ID = _STATUS_ID
                WHERE ID = _PIE_ID;
                /*
                WHERE INVOICEREQUIREMENT_ID = (SELECT IR.ID FROM INVOICEREQUIREMENTS IR
                        INNER JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
                        INNER JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
                        INNER JOIN INVOICES I ON IRO.INVOICE_ID = I.ID
                        INNER JOIN CASH_RECEIPTS CR ON CR.INVOICE_ID = I.ID
                        WHERE CR.ID = _ID);
                */
        SET _PIE_AMOUNT_TOTAL = _PIE_AMOUNT_TOTAL + _PIE_AMOUNT;
        END LOOP;
        CLOSE cur2;





        SET _AMOUNT_PAID_RON = (SELECT AMOUNT_PAID_RON FROM INVOICES WHERE ID = (SELECT INVOICE_ID FROM CASH_RECEIPTS WHERE ID = _ID));
        IF _AMOUNT_PAID_RON > _AMOUNT THEN
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'partially paid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'invoice_status'));
        ELSE
                SET _STATUS_ID =  (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'unpaid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'invoice_status'));
        END IF;
        
        UPDATE INVOICES SET
                STATUS_ID = _STATUS_ID,
                AMOUNT_PAID_RON = AMOUNT_PAID_RON - _AMOUNT
        WHERE ID = (SELECT INVOICE_ID FROM CASH_RECEIPTS WHERE ID = _ID);

        -- DELETE FROM INCOME_EXPENSES WHERE INVOICE_ID = (SELECT INVOICE_ID FROM CASH_RECEIPTS WHERE ID = _ID) AND AMOUNT = (SELECT AMOUNT_PAID_RON FROM CASH_RECEIPTS WHERE ID = _ID); -- AND DATE = (SELECT DATE FROM CASH_RECEIPTS WHERE ID = _ID)
        -- DELETE FROM COMPANY_INCOME_EXPENSES WHERE INVOICE_ID = (SELECT INVOICE_ID FROM CASH_RECEIPTS WHERE ID = _ID) AND AMOUNT = (SELECT AMOUNT_PAID_RON FROM CASH_RECEIPTS WHERE ID = _ID); -- AND DATE = (SELECT DATE FROM CASH_RECEIPTS WHERE ID = _ID) 

        DELETE FROM CASH_RECEIPTS WHERE ID = _ID;
        -- CHECK CURRENCY DEPENDENCY
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

