--
-- Definition of procedure `COMPANY_INCOME_EXPENSESsp_change_status`
--

DROP PROCEDURE IF EXISTS `COMPANY_INCOME_EXPENSESsp_change_status`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `COMPANY_INCOME_EXPENSESsp_change_status`(
        _ID INT,
        _DELETED BOOLEAN
)
BEGIN
        UPDATE COMPANY_INCOME_EXPENSES
        SET
