CREATE DEFINER=`root`@`localhost` PROCEDURE `COMPANY_INCOME_EXPENSESsp_get_by_invoice_id`(_INVOICE_ID INT)
BEGIN
        SELECT PIE.*, IR.ID INVOICEREQUIREMENT_ID, IRO.INVOICE_ID FROM COMPANY_INCOME_EXPENSES PIE
        INNER JOIN INVOICEREQUIREMENTS IR ON PIE.INVOICEREQUIREMENT_ID = IR.ID
        INNER JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
        INNER JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
        WHERE IRO.INVOICE_ID = _INVOICE_ID AND PIE.DELETED != TRUE AND TYPE=1 AND PIE.DATE <= CURDATE();
