--
-- Definition of procedure `COMPANY_INCOME_EXPENSESsp_select`
--

DROP PROCEDURE IF EXISTS `COMPANY_INCOME_EXPENSESsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `COMPANY_INCOME_EXPENSESsp_select`()
BEGIN
        SELECT PIE.ID, IF(PIE.TYPE=0,'EXPENSE','INCOME') TYPE, PIE.CURRENCY, PIE.AMOUNT, PIE.DATE,
        PIE.OWNER_ID, O.NAME OWNER, PIE.PROPERTY_ID, P.NAME PROPERTY,
        PIE.CONTRACTSERVICE_ID, S.NAME SERVICE, PIE.SERVICE_DESCRIPTION,
        PIE.MONTH, PIE.INVOICEREQUIREMENT_ID,
        PIE.CONTRACT_SERVICE_ADDITIONAL_COST_ID, PIE.STATUS_ID, L.NAME `STATUS`,
        PIE.BALLANCE,
        PIE.INVOICE_ID, CONCAT(I.SERIES,' ',LPAD(I.NUMBER,5,'0'),' / ',DATE_FORMAT(I.DATE, '%d.%m.%Y')) INVOICE
        FROM COMPANY_INCOME_EXPENSES PIE
        INNER JOIN OWNERS O ON PIE.OWNER_ID = O.ID
        INNER JOIN PROPERTIES P ON PIE.PROPERTY_ID = P.ID
        INNER JOIN SERVICES S ON PIE.CONTRACTSERVICE_ID = S.ID
        LEFT JOIN INVOICES I ON PIE.INVOICE_ID = I.ID
        LEFT JOIN LISTS L ON PIE.STATUS_ID = L.ID
        WHERE PIE.DELETED != TRUE;     
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

