--
-- Definition of procedure `CONTRACTSsp_delete_chain`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_delete_chain`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_delete_chain`(_ID INT)
BEGIN
        DECLARE _PREVIOUS_CONTRACT_ID INT;
        SET _PREVIOUS_CONTRACT_ID = (SELECT ID FROM CONTRACTS WHERE ID = (SELECT MAX(ID) ID FROM CONTRACTS WHERE NUMBER = (SELECT NUMBER FROM CONTRACTS WHERE ID = _ID) AND ID < _ID));

        DELETE FROM INCOME_EXPENSES WHERE
        CONTRACTSERVICE_ID IN
                (SELECT SERVICE_ID FROM CONTRACTS_PROPERTIES_SERVICES CPS
                INNER JOIN CONTRACTS_PROPERTIES  CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) AND
        (PROPERTY_ID IN
                (SELECT PROPERTY_ID FROM CONTRACTS_PROPERTIES  CP
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) OR PROPERTY_ID IS NULL) AND
        SERVICE_DESCRIPTION = '100%' AND
        INVOICEREQUIREMENT_ID IS NULL AND
        DELETED != TRUE;

        DELETE FROM COMPANY_INCOME_EXPENSES WHERE
        CONTRACTSERVICE_ID IN
                (SELECT SERVICE_ID FROM CONTRACTS_PROPERTIES_SERVICES CPS
                INNER JOIN CONTRACTS_PROPERTIES  CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) AND
        (PROPERTY_ID IN
                (SELECT PROPERTY_ID FROM CONTRACTS_PROPERTIES  CP
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) OR PROPERTY_ID IS NULL) AND
        SERVICE_DESCRIPTION = '100%' AND
        INVOICEREQUIREMENT_ID IS NULL AND
        DELETED != TRUE;

        DELETE FROM INCOME_EXPENSES WHERE
        DELETED != TRUE AND
        CONTRACT_SERVICE_ADDITIONAL_COST_ID IN
                (SELECT ID FROM CONTRACT_SERVICES_ADDITIONAL_COSTS WHERE
                CONTRACTPROPERTYSERVICE_ID IN
                        (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE
                        CONTRACT_PROPERTY_ID IN
                                (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID)));

        DELETE FROM COMPANY_INCOME_EXPENSES WHERE
        DELETED != TRUE AND
        CONTRACT_SERVICE_ADDITIONAL_COST_ID IN
                (SELECT ID FROM CONTRACT_SERVICES_ADDITIONAL_COSTS WHERE
                CONTRACTPROPERTYSERVICE_ID IN
                        (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE
                        CONTRACT_PROPERTY_ID IN
                                (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID)));

        DELETE FROM CONTRACT_SERVICES_ADDITIONAL_COSTS WHERE
        CONTRACTPROPERTYSERVICE_ID IN
                (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE
                CONTRACT_PROPERTY_ID IN
                        (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID));

        DELETE FROM COMPANY_INCOME_EXPENSES WHERE
        CONTRACTSERVICE_ID IN
                (SELECT SERVICE_ID FROM CONTRACTS_PROPERTIES_SERVICES CPS
                INNER JOIN CONTRACTS_PROPERTIES  CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) AND
        (PROPERTY_ID IN
                (SELECT PROPERTY_ID FROM CONTRACTS_PROPERTIES  CP
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _ID) OR PROPERTY_ID IS NULL) AND
        SERVICE_DESCRIPTION = '100%' AND
        INVOICEREQUIREMENT_ID IS NULL AND
        DELETED != TRUE;

        DELETE FROM INCOME_EXPENSES WHERE CONTRACT_SERVICE_ADDITIONAL_COST_ID IN (SELECT ID FROM CONTRACT_SERVICES_ADDITIONAL_COSTS WHERE CONTRACTPROPERTYSERVICE_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE CONTRACT_PROPERTY_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID)));
        DELETE FROM INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _ID); -- AND DELETED != TRUE;
        DELETE FROM COMPANY_INCOME_EXPENSES WHERE CONTRACT_SERVICE_ADDITIONAL_COST_ID IN (SELECT ID FROM CONTRACT_SERVICES_ADDITIONAL_COSTS WHERE CONTRACTPROPERTYSERVICE_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE CONTRACT_PROPERTY_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID)));
        DELETE FROM COMPANY_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _ID); -- AND DELETED != TRUE;
        DELETE FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _ID; -- AND DELETED != TRUE;
        DELETE FROM CONTRACTS_PROPERTIES_SERVICES WHERE CONTRACT_PROPERTY_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID);
        DELETE FROM CONTRACTS_REASONS WHERE CONTRACT_ID = _ID;
        DELETE FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _ID;
        DELETE FROM CONTRACTS WHERE PARENT_CONTRACT_ID = _ID;
        DELETE FROM CONTRACTS WHERE ID = _ID;

        IF _PREVIOUS_CONTRACT_ID IS NOT NULL THEN
                BEGIN
                DECLARE done INT DEFAULT FALSE;
                DECLARE _INVOICEREQUIREMENT_ID INT;
                DECLARE cur1 CURSOR FOR
                        SELECT IR.ID FROM CONTRACTS C
                                INNER JOIN INVOICEREQUIREMENTS IR ON C.ID = IR.CONTRACT_ID
                                WHERE C.ID = _PREVIOUS_CONTRACT_ID;
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
                OPEN cur1;
                read_loop:LOOP
                        FETCH cur1 INTO _INVOICEREQUIREMENT_ID;
                        IF done THEN
                                LEAVE read_loop;
                        END IF;
                        CALL INVOICEREQUIREMENTSsp_change_status(_INVOICEREQUIREMENT_ID, FALSE);
                END LOOP;
                CLOSE cur1;
                END;
        END IF;

        IF _PREVIOUS_CONTRACT_ID IS NOT NULL THEN
                BEGIN
                DECLARE done INT DEFAULT FALSE;
                DECLARE _CONTRACT_SERVICE_ADITIONAL_COST_ID INT;
                DECLARE cur1 CURSOR FOR
                        SELECT CSAD.ID FROM CONTRACTS C
                                INNER JOIN CONTRACTS_PROPERTIES CP ON C.ID = CP.CONTRACT_ID
                                INNER JOIN CONTRACTS_PROPERTIES_SERVICES CPS ON CP.ID = CPS.CONTRACT_PROPERTY_ID
                                INNER JOIN CONTRACT_SERVICES_ADDITIONAL_COSTS CSAD ON CPS.ID = CONTRACTPROPERTYSERVICE_ID
                                WHERE C.ID = _PREVIOUS_CONTRACT_ID;
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
                OPEN cur1;
                read_loop:LOOP
                        FETCH cur1 INTO _CONTRACT_SERVICE_ADITIONAL_COST_ID;
                        IF done THEN
                                LEAVE read_loop;
                        END IF;
                        CALL INCOME_EXPENSESsp_change_status_by_contractservice_id(_CONTRACT_SERVICE_ADITIONAL_COST_ID, FALSE);
                        CALL COMPANY_IEsp_change_status_by_contractservice_id(_CONTRACT_SERVICE_ADITIONAL_COST_ID, FALSE);
                END LOOP;
                CLOSE cur1;

                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTSsp_get_by_contract_id_property_id`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_get_by_contract_id_property_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_get_by_contract_id_property_id`(
        _CONTRACT_ID INT,
        _PROPERTY_ID INT
)
BEGIN
        SELECT C.ID CONTRACT_ID, CPS.*, S.NAME SERVICE FROM
                (SELECT * FROM CONTRACTS C INNER JOIN
                (SELECT MAX(ADDENDUM_NUMBER) A_N, NUMBER N FROM CONTRACTS GROUP BY NUMBER) C2 ON C.NUMBER=C2.N AND C.ADDENDUM_NUMBER=C2.A_N) C
        INNER JOIN CONTRACTS_PROPERTIES CPP ON C.ID = CPP.CONTRACT_ID
        LEFT JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        -- INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        INNER JOIN OWNERS O ON C.OWNER_ID = O.ID
        INNER JOIN CONTRACTS_PROPERTIES_SERVICES CPS ON CPP.ID = CPS.CONTRACT_PROPERTY_ID
        INNER JOIN SERVICES S ON CPS.SERVICE_ID = S.ID
        WHERE C.ID = _CONTRACT_ID AND (P.ID = _PROPERTY_ID OR (PROPERTY_ID IS NULL AND _PROPERTY_ID IS NULL));
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTSsp_get_by_id`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_get_by_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_get_by_id`(_ID INT)
BEGIN
        SELECT C.ID, C.NUMBER,
        C.ADDENDUM_NUMBER, C.ADDENDUM_DATE,
        C.PARENT_CONTRACT_ID, CP.NUMBER PARENT_CONTRACT_NUMBER,
        O.ID OWNER_ID, O.NAME OWNER,
        C.START_DATE, C.FINISH_DATE, C.CURRENCY,
        C.STATUS_ID, LS.NAME STATUS, C.EXPIRATION_DATE, C.EXPIRED_ID, LE.NAME `SIGNED?`,
        C.AUTOMATICALLY_RENEWED
        FROM CONTRACTS C
        INNER JOIN
                (SELECT MAX(ID) ID, CONTRACT_ID, PROPERTY_ID FROM CONTRACTS_PROPERTIES GROUP BY CONTRACT_ID) CPP ON C.ID = CPP.CONTRACT_ID
        INNER JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        LEFT JOIN CONTRACTS CP ON C.PARENT_CONTRACT_ID = CP.ID
        LEFT JOIN LISTS LS ON C.STATUS_ID = LS.ID
        LEFT JOIN LISTS LE ON C.EXPIRED_ID = LE.ID
        WHERE C.ID = _ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTSsp_get_by_property_id`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_get_by_property_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_get_by_property_id`(
        _PROPERTY_ID INT
)
BEGIN        /*
        SELECT C.ID, C.NUMBER, O.ID OWNER_ID, O.NAME OWNER,
        C.START_DATE, C.FINISH_DATE, C.PARENT_CONTRACT_ID, CP.NUMBER PARENT_CONTRACT_NUMBER,
        C.STATUS_ID, LS.NAME STATUS, C.EXPIRATION_DATE, C.EXPIRED_ID, LE.NAME EXPIRED,
        C.AUTOMATICALLY_RENEWED
        */
        SELECT C.ID CONTRACT_ID, CPS.*, S.NAME SERVICE FROM
                (SELECT * FROM CONTRACTS C INNER JOIN
                (SELECT MAX(ADDENDUM_NUMBER) A_N, NUMBER N FROM CONTRACTS GROUP BY NUMBER) C2 ON C.NUMBER=C2.N AND C.ADDENDUM_NUMBER=C2.A_N) C
        INNER JOIN CONTRACTS_PROPERTIES CPP ON C.ID = CPP.CONTRACT_ID
        LEFT JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        -- INNER JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        -- INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        INNER JOIN OWNERS O ON C.OWNER_ID = O.ID
        INNER JOIN CONTRACTS_PROPERTIES_SERVICES CPS ON CPP.ID = CPS.CONTRACT_PROPERTY_ID
        INNER JOIN SERVICES S ON CPS.SERVICE_ID = S.ID
        WHERE P.ID = _PROPERTY_ID AND C.ID = (SELECT MAX(CONTRACT_ID) FROM CONTRACTS_PROPERTIES WHERE PROPERTY_ID = _PROPERTY_ID GROUP BY PROPERTY_ID );
        /*
        LEFT JOIN CONTRACTS CP ON C.PARENT_CONTRACT_ID = CP.ID
        LEFT JOIN LISTS LS ON C.STATUS_ID = LS.ID
        LEFT JOIN LISTS LE ON C.EXPIRED_ID = LE.ID
        ORDER BY C.NUMBER;
        */
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

