--
-- Definition of procedure `CONTRACTSsp_get_owner`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_get_owner`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_get_owner`(_OWNER_ID INT)
BEGIN
        IF EXISTS (SELECT C.ID FROM CONTRACTS C
                INNER JOIN CONTRACTS_PROPERTIES CP ON C.ID = CP.CONTRACT_ID
                INNER JOIN PROPERTIES P ON CP.PROPERTY_ID = P.ID
                WHERE P.OWNER_ID = _OWNER_ID AND C.STATUS_ID IN (SELECT ID FROM LISTS WHERE LOWER(NAME) IN ('active') AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'contract_status'))) THEN
                SELECT TRUE FROM CONTRACTS LIMIT 1;
        ELSE
                SELECT FALSE FROM CONTRACTS LIMIT 1;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTSsp_get_renewable`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_get_renewable`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_get_renewable`()
BEGIN
        SELECT C.ID, C.NUMBER,
        C.ADDENDUM_NUMBER, C.ADDENDUM_DATE,
        C.PARENT_CONTRACT_ID, CP.NUMBER PARENT_CONTRACT_NUMBER,
        O.ID OWNER_ID, O.NAME OWNER,
        C.START_DATE, C.FINISH_DATE, C.CURRENCY,
        C.STATUS_ID, LS.NAME STATUS, C.EXPIRATION_DATE, C.EXPIRED_ID, LE.NAME `SIGNED?`,
        C.AUTOMATICALLY_RENEWED
        FROM CONTRACTS C

        INNER JOIN
                (SELECT MAX(ADDENDUM_NUMBER) ADN, NUMBER FROM CONTRACTS GROUP BY NUMBER) CC ON C.NUMBER = CC.NUMBER AND (C.ADDENDUM_NUMBER = CC.ADN OR CC.ADN IS NULL)

        INNER JOIN
                (SELECT MAX(ID), CONTRACT_ID, ID, PROPERTY_ID FROM CONTRACTS_PROPERTIES GROUP BY CONTRACT_ID) CPP ON C.ID = CPP.CONTRACT_ID

        INNER JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        LEFT JOIN CONTRACTS CP ON C.PARENT_CONTRACT_ID = CP.ID
        LEFT JOIN LISTS LS ON C.STATUS_ID = LS.ID
        LEFT JOIN LISTS LE ON C.EXPIRED_ID = LE.ID
        WHERE
        C.AUTOMATICALLY_RENEWED = TRUE AND
        C.EXPIRATION_DATE <= CURDATE();
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTSsp_has_changes`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_has_changes`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_has_changes`(_ID INT, _NUMBER VARCHAR(100), _ADENDUM_NUMBER VARCHAR(100))
BEGIN
        DECLARE _HAS_CHANGES INT;

        SET _HAS_CHANGES = (SELECT COUNT(*) NEXT_ADENDUMS FROM
                (SELECT DISTINCT ADDENDUM_NUMBER FROM CONTRACTS WHERE NUMBER = _NUMBER AND ADDENDUM_NUMBER <> _ADENDUM_NUMBER AND ID > _ID GROUP BY NUMBER) NA);

        IF _HAS_CHANGES IS NULL OR _HAS_CHANGES <= 0 THEN
                BEGIN
                SET _HAS_CHANGES = (SELECT COUNT(*) INVOICED_REQUIREMENTS FROM
                        INVOICEREQUIREMENTS IR
                        WHERE IR.STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Invoiced' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'invoicerequirement_status')) AND
                        IR.CONTRACT_ID = _ID);
                END;
        END IF;

        SELECT _HAS_CHANGES;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

