--
-- Definition of procedure `CONTRACTSsp_select`
--

DROP PROCEDURE IF EXISTS `CONTRACTSsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTSsp_select`()
BEGIN
                DECLARE done INT DEFAULT FALSE;
                DECLARE _CONTRACT_ID INT;
                DECLARE _SERVICE VARCHAR(250);
                DECLARE _SERVICE_ID INT;
                DECLARE _T VARCHAR(4000);

                DECLARE cur1 CURSOR FOR
                        SELECT ID, NAME FROM SERVICES ORDER BY NAME;

                DECLARE cur2 CURSOR FOR
                        SELECT CP.CONTRACT_ID, S.NAME SERVICE FROM CONTRACTS_PROPERTIES_SERVICES CPS
                                INNER JOIN CONTRACTS_PROPERTIES CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                                INNER JOIN SERVICES S ON CPS.SERVICE_ID = S.ID;

                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

                DROP TABLE IF EXISTS  _contracts_services_tranposed;
                CREATE TEMPORARY TABLE _contracts_services_tranposed (CONTRACT_ID INT);
                INSERT INTO _contracts_services_tranposed SELECT ID FROM CONTRACTS;

                OPEN cur1;
                read_loop1:LOOP
                        FETCH cur1 INTO _SERVICE_ID, _SERVICE;
                        IF done THEN
                                LEAVE read_loop1;
                        END IF;
                        SET @_T = CONCAT('ALTER TABLE _contracts_services_tranposed ADD COLUMN `', REPLACE(_SERVICE, ' ', '_'), '` BOOL;');
                        PREPARE stmt1 FROM @_T;
                        EXECUTE stmt1;
                        DEALLOCATE PREPARE stmt1;
                END LOOP;
                CLOSE cur1;

                SET done = false;
                OPEN cur2;
                read_loop:LOOP
                        FETCH cur2 INTO _CONTRACT_ID, _SERVICE;
                        IF done THEN
                                LEAVE read_loop;
                        END IF;
                        SET @_T = CONCAT('UPDATE _contracts_services_tranposed SET `', REPLACE(_SERVICE, ' ', '_'), '` = TRUE WHERE CONTRACT_ID = ', _CONTRACT_ID, ';');
                        PREPARE stmt1 FROM @_T;
                        EXECUTE stmt1;
                        DEALLOCATE PREPARE stmt1;
                END LOOP;
                CLOSE cur2;



        SELECT C.ID, C.NUMBER,
        C.ADDENDUM_NUMBER, C.ADDENDUM_DATE,
        C.PARENT_CONTRACT_ID, CP.NUMBER PARENT_CONTRACT_NUMBER,
        O.ID OWNER_ID, O.NAME OWNER,
        C.START_DATE, C.FINISH_DATE, C.CURRENCY,
        C.STATUS_ID, LS.NAME STATUS, C.EXPIRATION_DATE, C.EXPIRED_ID, LE.NAME `SIGNED?`,
        C.AUTOMATICALLY_RENEWED, TCS.*
        FROM CONTRACTS C
        INNER JOIN
                (SELECT MAX(ID), CONTRACT_ID, ID, PROPERTY_ID FROM CONTRACTS_PROPERTIES GROUP BY CONTRACT_ID) CPP ON C.ID = CPP.CONTRACT_ID
        INNER JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        LEFT JOIN CONTRACTS CP ON C.PARENT_CONTRACT_ID = CP.ID
        LEFT JOIN LISTS LS ON C.STATUS_ID = LS.ID
        LEFT JOIN LISTS LE ON C.EXPIRED_ID = LE.ID
        LEFT JOIN _contracts_services_tranposed TCS ON C.ID = TCS.CONTRACT_ID
        ORDER BY C.NUMBER ASC, ADDENDUM_NUMBER DESC;

        -- DROP TABLE _contracts_services_tranposed;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

