        CONTRACTPROPERTYSERVICE_ID IN
                (SELECT ID FROM CONTRACTS_PROPERTIES_SERVICES WHERE
                CONTRACT_PROPERTY_ID IN
                        (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _CONTRACT_ID));

        DELETE FROM CONTRACTS_PROPERTIES_SERVICES
        WHERE CONTRACT_PROPERTY_ID IN (SELECT ID FROM CONTRACTS_PROPERTIES WHERE CONTRACT_ID = _CONTRACT_ID);
