DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTS_PROPERTIES_SERVICESsp_select_by_contract_id`(_CONTRACT_ID INT)
BEGIN
        /*
        SELECT DISTINCT CPS.SERVICE_ID, S.NAME SERVICE, CPS.PRICE_VALUE,
        CPS.PRICE_PERCENT, CPS.PRICE_ONE_PAYMENT, CPS.PRICE_VALUE_APPLICABLE,
        CPS.PRICE_PERCENT_APPLICABLE, CPS.PRICE_ONE_PAYMENT_APPLICABLE
        FROM CONTRACTS_PROPERTIES_SERVICES CPS
        INNER JOIN CONTRACTS_PROPERTIES CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
        LEFT JOIN SERVICES S ON CPS.SERVICE_ID = S.ID
        WHERE CP.CONTRACT_ID = _CONTRACT_ID ;
        */
        SELECT DISTINCT CPS.ID, CPS.SERVICE_ID, S.NAME SERVICE, CPS.VALUE,
        CPS.PERIOD, CPS.PERCENT, CPS.MODIFY, P.ID PROPERTY_ID
        FROM CONTRACTS_PROPERTIES_SERVICES CPS
        INNER JOIN CONTRACTS_PROPERTIES CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
        LEFT JOIN PROPERTIES P ON CP.PROPERTY_ID = P.ID
        LEFT JOIN SERVICES S ON CPS.SERVICE_ID = S.ID
        WHERE CP.CONTRACT_ID = _CONTRACT_ID ;         
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CONTRACTS_PROPERTIES_SERVICESsp_select_by_contract_id_last`
