--
-- Definition of procedure `CONTRACTS_SERVICESsp_get_by_contract_id`
--

DROP PROCEDURE IF EXISTS `CONTRACTS_SERVICESsp_get_by_contract_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CONTRACTS_SERVICESsp_get_by_contract_id`(
        _CONTRACT_ID INT
)
BEGIN
        SELECT C.ID CONTRACT_ID, CPS.*, S.NAME SERVICE FROM
                (SELECT * FROM CONTRACTS C INNER JOIN
                (SELECT MAX(ADDENDUM_NUMBER) A_N, NUMBER N FROM CONTRACTS GROUP BY NUMBER) C2 ON C.NUMBER=C2.N AND C.ADDENDUM_NUMBER=C2.A_N) C
        INNER JOIN CONTRACTS_PROPERTIES CPP ON C.ID = CPP.CONTRACT_ID
        LEFT JOIN PROPERTIES P ON CPP.PROPERTY_ID = P.ID
        -- INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        INNER JOIN OWNERS O ON C.OWNER_ID = O.ID
        INNER JOIN CONTRACTS_PROPERTIES_SERVICES CPS ON CPP.ID = CPS.CONTRACT_PROPERTY_ID
        INNER JOIN SERVICES S ON CPS.SERVICE_ID = S.ID
        WHERE C.ID = _CONTRACT_ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

