--
-- Definition of procedure `CURRENCIESsp_get_by_date`
--

DROP PROCEDURE IF EXISTS `CURRENCIESsp_get_by_date`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CURRENCIESsp_get_by_date`(
        _DATE DATE
)
BEGIN
        SELECT C.* FROM CURRENCIES C
        INNER JOIN CURRENCIES_PRIORITIES CP ON C.CURRENCY = CP.CURRENCY
        WHERE DATE = (SELECT MAX(DATE) DATE FROM CURRENCIES WHERE DATE <= _DATE)
        ORDER BY CP.PRIORITY, C.CURRENCY;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `CURRENCIESsp_get_by_date_and_currency`
