DROP PROCEDURE IF EXISTS `CURRENCIESsp_get_by_date_and_currency`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CURRENCIESsp_get_by_date_and_currency`(
        _DATE DATE,
        _CURRENCY VARCHAR(5)
)
BEGIN
        SELECT IF(MULTIPLIER != NULL, RATE/MULTIPLIER, RATE) RATE
        FROM CURRENCIES WHERE DATE =
        (SELECT MAX(DATE) DATE FROM CURRENCIES WHERE DATE <= _DATE) AND
        CURRENCY = _CURRENCY;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

