DROP PROCEDURE IF EXISTS `CURRENCIESsp_get_currencies_list`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CURRENCIESsp_get_currencies_list`()
BEGIN         
        -- SELECT MAX(ID) ID, CURRENCY FROM CURRENCIES GROUP BY CURRENCY ORDER BY CURRENCY;
        SELECT C.CURRENCY FROM
        (SELECT 'RON' CURRENCY FROM CURRENCIES LIMIT 1
        UNION SELECT DISTINCT CURRENCY FROM CURRENCIES) C
        INNER JOIN CURRENCIES_PRIORITIES CP ON C.CURRENCY = CP.CURRENCY
        ORDER BY CP.PRIORITY;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

