DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `EMPLOYEESsp_get_rights`(_ID INT)
BEGIN
        SELECT ER.*, R.NAME FROM EMPLOYEES_ROLES ER
                INNER JOIN ROLES R ON ER.ROLE_ID = R.ID
                WHERE ER.EMPLOYEE_ID = _ID;

        SELECT GR.*, R.NAME FROM GROUPS G
                INNER JOIN GROUPS_ROLES GR ON G.ID = GR.GROUP_ID
                INNER JOIN GROUPS_EMPLOYEES GE ON G.ID = GE.GROUP_ID
                INNER JOIN ROLES R ON GR.ROLE_ID = R.ID
                WHERE GE.EMPLOYEE_ID = _ID;
END $$
