--
-- Definition of procedure `EMPLOYEES_USERSETTINGSsp_update_by_setting_name`
--

DROP PROCEDURE IF EXISTS `EMPLOYEES_USERSETTINGSsp_update_by_setting_name`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `EMPLOYEES_USERSETTINGSsp_update_by_setting_name`(
        _EMPLOYEE_ID INT,
        _USERSETTING_NAME VARCHAR(100),
        _VALUE VARCHAR(100)
)
BEGIN
        DECLARE _USERSETTING_ID INT;

        IF EXISTS (SELECT ID FROM EMPLOYEES_USERSETTINGS
        WHERE EMPLOYEE_ID = _EMPLOYEE_ID AND
        USERSETTING_ID = (SELECT ID FROM USERSETTINGS WHERE NAME = _USERSETTING_NAME LIMIT 1))
        THEN
                BEGIN
                UPDATE EMPLOYEES_USERSETTINGS SET
                `VALUE` = _VALUE
                WHERE EMPLOYEE_ID = _EMPLOYEE_ID AND
                USERSETTING_ID = (SELECT ID FROM USERSETTINGS WHERE NAME = _USERSETTING_NAME LIMIT 1);
                END;
        ELSE
                BEGIN
                SET _USERSETTING_ID = (SELECT ID FROM USERSETTINGS WHERE NAME = _USERSETTING_NAME LIMIT 1);
                IF _USERSETTING_ID IS NULL THEN
                        BEGIN
                        INSERT INTO USERSETTINGS SET NAME = _USERSETTING_NAME;
                        SET _USERSETTING_ID = LAST_INSERT_ID();
                        END;
                END IF;
                INSERT INTO EMPLOYEES_USERSETTINGS SET
                        VALUE = _VALUE,
                        EMPLOYEE_ID = _EMPLOYEE_ID,
                        USERSETTING_ID = _USERSETTING_ID;
                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

