--
-- Definition of procedure `INCOME_EXPENSESsp_change_status3`
--

DROP PROCEDURE IF EXISTS `INCOME_EXPENSESsp_change_status3`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INCOME_EXPENSESsp_change_status3`(_ID INT, _SOURCE BOOLEAN, _AMOUNT DOUBLE)
BEGIN
        DECLARE _BALLANCE DOUBLE;
        SET _BALLANCE = (SELECT BALLANCE FROM INCOME_EXPENSES WHERE ID = _ID);
        IF _AMOUNT < _BALLANCE THEN
                BEGIN
                UPDATE INCOME_EXPENSES SET
                        SOURCE = _SOURCE,
                        BALLANCE = IFNULL(BALLANCE,0) - _AMOUNT,
                        STATUS_ID = (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'partially paid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'))
                        WHERE ID = _ID;
                END;
        ELSE
                BEGIN
                UPDATE INCOME_EXPENSES SET
                        SOURCE = _SOURCE,
                        BALLANCE = IFNULL(BALLANCE,0) - _AMOUNT,
                        STATUS_ID = (SELECT ID FROM LISTS WHERE LOWER(NAME) = 'paid' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE LOWER(NAME) = 'ie_status'))
                        WHERE ID = _ID;
                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

