--
-- Definition of procedure `INCOME_EXPENSESsp_get_by_owner_id2`
--

DROP PROCEDURE IF EXISTS `INCOME_EXPENSESsp_get_by_owner_id2`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INCOME_EXPENSESsp_get_by_owner_id2`(_OWNER_ID INT)
BEGIN
        SELECT PIE.ID, IF(PIE.TYPE=0, 'EXPENSE', 'INCOME') TYPE, PIE.CURRENCY, IF(PIE.TYPE=0, -1 * PIE.BALLANCE, PIE.BALLANCE) BALLANCE, IF(PIE.TYPE=0, -1 * PIE.AMOUNT, PIE.AMOUNT) AMOUNT_CURRENCY, PIE.DATE, PIE.OWNER_ID,
                PIE.PROPERTY_ID, PIE.CONTRACTSERVICE_ID, PIE.SERVICE_DESCRIPTION, PIE.MONTH, PIE.INVOICEREQUIREMENT_ID, PIE.CONTRACT_SERVICE_ADDITIONAL_COST_ID,
                PIE.STATUS_ID, L.NAME STATUS, IR.ID INVOICEREQUIREMENT_ID, I.ID INVOICE_ID
        FROM INCOME_EXPENSES PIE
        LEFT JOIN LISTS L ON PIE.STATUS_ID = L.ID
        /*
        LEFT JOIN INVOICEREQUIREMENTS IR ON PIE.INVOICEREQUIREMENT_ID = IR.ID
        LEFT JOIN INVOICEREQUIREMENTS_INVOICEROWS IRIR ON IR.ID = IRIR.INVOICEREQUIREMENT_ID
        LEFT JOIN INVOICEROWS IRO ON IRIR.INVOICEROW_ID = IRO.ID
        LEFT JOIN INVOICES I ON IRO.INVOICE_ID = I.ID
        WHERE PIE.OWNER_ID = _OWNER_ID AND PIE.DELETED != TRUE
        */
        LEFT JOIN INVOICES I ON PIE.INVOICE_ID = I.ID
        LEFT JOIN INVOICEREQUIREMENTS IR ON PIE.INVOICEREQUIREMENT_ID = IR.ID
        WHERE PIE.OWNER_ID = _OWNER_ID AND PIE.DELETED != TRUE AND PIE.STATUS_ID NOT IN (SELECT ID FROM LISTS WHERE NAME = 'Paid')
        ORDER BY PIE.PROPERTY_ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

