DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICEREQUIREMENTSsp_delete`(_ID INT)
BEGIN
        DELETE FROM PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _ID;
        DELETE FROM COMPANY_PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _ID;

