--
-- Definition of procedure `INVOICEREQUIREMENTSsp_delete_by_contract_id`
--

DROP PROCEDURE IF EXISTS `INVOICEREQUIREMENTSsp_delete_by_contract_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICEREQUIREMENTSsp_delete_by_contract_id`(_CONTRACT_ID INT)
BEGIN
        DELETE FROM INCOME_EXPENSES WHERE
        CONTRACTSERVICE_ID IN
                (SELECT SERVICE_ID FROM CONTRACTS_PROPERTIES_SERVICES CPS
                INNER JOIN CONTRACTS_PROPERTIES  CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _CONTRACT_ID) AND
        (PROPERTY_ID IN
                (SELECT PROPERTY_ID FROM CONTRACTS_PROPERTIES  CP
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _CONTRACT_ID) OR PROPERTY_ID IS NULL) AND
        SERVICE_DESCRIPTION = '100%' AND
        INVOICEREQUIREMENT_ID IS NULL AND
        DELETED != TRUE;


        DELETE FROM COMPANY_INCOME_EXPENSES WHERE
        CONTRACTSERVICE_ID IN
                (SELECT SERVICE_ID FROM CONTRACTS_PROPERTIES_SERVICES CPS
                INNER JOIN CONTRACTS_PROPERTIES  CP ON CPS.CONTRACT_PROPERTY_ID = CP.ID
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _CONTRACT_ID) AND
        (PROPERTY_ID IN
                (SELECT PROPERTY_ID FROM CONTRACTS_PROPERTIES  CP
                INNER JOIN CONTRACTS C ON C.ID = CP.CONTRACT_ID
                WHERE C.ID = _CONTRACT_ID) OR PROPERTY_ID IS NULL) AND
        SERVICE_DESCRIPTION = '100%' AND
        INVOICEREQUIREMENT_ID IS NULL AND
        DELETED != TRUE;


        DELETE FROM INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _CONTRACT_ID) AND DELETED != TRUE;
        DELETE FROM COMPANY_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _CONTRACT_ID) AND DELETED != TRUE;

        DELETE FROM INVOICEREQUIREMENTS WHERE CONTRACT_ID = _CONTRACT_ID AND DELETED != TRUE;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

