--
-- Definition of procedure `INVOICEREQUIREMENTSsp_delete_by_month2`
--

DROP PROCEDURE IF EXISTS `INVOICEREQUIREMENTSsp_delete_by_month2`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICEREQUIREMENTSsp_delete_by_month2`(
        _PROPERTY_ID INT,
        _CONTRACT_ID INT,
        _MONTH VARCHAR(100),
        _SERVICE_ID INT
)
BEGIN
        DECLARE _INVOICEREQUIREMENT_ID INT;
        DECLARE _OLD_CONTRACT_ID INT;
        SET  _OLD_CONTRACT_ID = (SELECT MAX(ID) ID FROM CONTRACTS WHERE NUMBER = (SELECT NUMBER FROM CONTRACTS WHERE ID = _CONTRACT_ID) AND ID <> _CONTRACT_ID GROUP BY NUMBER);

        SET _INVOICEREQUIREMENT_ID = (SELECT ID FROM INVOICEREQUIREMENTS WHERE
                (PROPERTY_ID = _PROPERTY_ID OR PROPERTY_ID IS NULL) AND
                CONTRACT_ID = _OLD_CONTRACT_ID AND
                (MONTH = _MONTH OR _MONTH IS NULL) AND
                CONTRACTSERVICE_ID = _SERVICE_ID LIMIT 1);

        IF _INVOICEREQUIREMENT_ID IS NOT NULL THEN
                BEGIN
                        DELETE FROM PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _INVOICEREQUIREMENT_ID;
                        DELETE FROM COMPANY_PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _INVOICEREQUIREMENT_ID;
                END;
        END IF;

        DELETE FROM INVOICEREQUIREMENTS WHERE
        (PROPERTY_ID = _PROPERTY_ID OR PROPERTY_ID IS NULL) AND
        CONTRACT_ID = _OLD_CONTRACT_ID AND
        (MONTH = _MONTH OR _MONTH IS NULL) AND
        CONTRACTSERVICE_ID = _SERVICE_ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

