DROP PROCEDURE IF EXISTS `INVOICEREQUIREMENTSsp_delete_by_property_contract_service`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICEREQUIREMENTSsp_delete_by_property_contract_service`(
        _PROPERTY_ID INT,
        _CONTRACT_ID INT,
        _CONTRACTSERVICE_ID INT
)
BEGIN
        DECLARE _INVOICEREQUIREMENT_ID INT;
        SET _INVOICEREQUIREMENT_ID = (SELECT ID FROM INVOICEREQUIREMENTS WHERE
                (PROPERTY_ID = _PROPERTY_ID OR PROPERTY_ID IS NULL) AND CONTRACT_ID = _CONTRACT_ID AND CONTRACTSERVICE_ID = _CONTRACTSERVICE_ID AND
                STATUS_ID != (SELECT ID FROM LISTS WHERE NAME='Invoiced' limit 1) LIMIT 1);
        IF _INVOICEREQUIREMENT_ID IS NOT NULL THEN
                BEGIN
                        DELETE FROM PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _INVOICEREQUIREMENT_ID;
                        DELETE FROM COMPANY_PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID = _INVOICEREQUIREMENT_ID;

                        DELETE FROM INVOICEREQUIREMENTS WHERE
                                (PROPERTY_ID = _PROPERTY_ID OR PROPERTY_ID IS NULL) AND CONTRACT_ID = _CONTRACT_ID AND CONTRACTSERVICE_ID = _CONTRACTSERVICE_ID;
                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `INVOICEREQUIREMENTSsp_get_by_contract_id`
