DROP PROCEDURE IF EXISTS `INVOICEREQUIREMENTSsp_get_by_contract_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICEREQUIREMENTSsp_get_by_contract_id`(_CONTRACT_ID INT)
BEGIN
        SELECT FALSE INVOICE, -- FALSE `GROUP`,
        IR.ID, IR.OWNER_ID, O.NAME OWNER, IR.PROPERTY_ID, P.NAME PROPERTY,
        IR.CONTRACTSERVICE_ID, S.NAME SERVICE, IR.PRICE, IR.MONTH, IR.DATE, IR.CURRENCY,
        IR.CONTRACT_ID, IR.RENTCONTRACT_ID, C.NUMBER CONTRACT, RC.NUMBER RENTCONTRACT,
        IR.STATUS_ID, -- LS.NAME STATUS,
        IR.COMMENTS, IR.NOT_INVOICEABLE
        FROM INVOICEREQUIREMENTS IR
        INNER JOIN OWNERS O ON IR.OWNER_ID = O.ID
        INNER JOIN PROPERTIES P ON IR.PROPERTY_ID = P.ID
        INNER JOIN SERVICES S ON IR.CONTRACTSERVICE_ID = S.ID
        LEFT JOIN CONTRACTS C ON IR.CONTRACT_ID = C.ID
        LEFT JOIN RENTCONTRACTS RC ON IR.RENTCONTRACT_ID = RC.ID
        INNER JOIN LISTS LS ON IR.STATUS_ID = LS.ID
        WHERE IR.CONTRACT_ID = _CONTRACT_ID
        -- AND LS.NAME != 'Inactive';
        AND IR.DELETED != TRUE;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

