        _PROPERTY_ID INT,
        _RENTCONTRACT_ID INT,
        _MONTH VARCHAR(100),
        _SERVICE_ID INT
)
BEGIN

        SELECT * FROM INVOICEREQUIREMENTS WHERE
        (PROPERTY_ID = _PROPERTY_ID OR PROPERTY_ID IS NULL) AND
        RENTCONTRACT_ID IN (SELECT ID FROM RENTCONTRACTS WHERE NUMBER = (SELECT NUMBER FROM RENTCONTRACTS WHERE ID = _RENTCONTRACT_ID)) AND
        (MONTH = _MONTH OR _MONTH IS NULL) AND
        CONTRACTSERVICE_ID = _SERVICE_ID
        AND DELETED != TRUE
        ORDER BY DATE DESC;
END $$
