--
-- Definition of procedure `INVOICESsp_change_status`
--

DROP PROCEDURE IF EXISTS `INVOICESsp_change_status`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICESsp_change_status`(_ID INT, _AMOUNT_PAID_RON DOUBLE)
BEGIN
        DECLARE _STATUS_ID INT;
        DECLARE _TOTAL_AMOUNT_PAID_RON DOUBLE;
        DECLARE _INVOICE_TOTAL_AMOUNT_RON DOUBLE;
        SET _TOTAL_AMOUNT_PAID_RON = (SELECT AMOUNT_PAID_RON FROM INVOICES WHERE ID = _ID);
        SET _INVOICE_TOTAL_AMOUNT_RON = (SELECT TOTAL_RON FROM INVOICES WHERE ID = _ID);


        IF IFNULL(_TOTAL_AMOUNT_PAID_RON, 0) + _AMOUNT_PAID_RON >= _INVOICE_TOTAL_AMOUNT_RON THEN
                SET _STATUS_ID = (SELECT ID FROM LISTS WHERE UPPER(NAME) = 'PAID' AND LIST_TYPE_ID = (SELECT ID FROM LIST_TYPES WHERE UPPER(NAME)='INVOICE_STATUS'));
        ELSE
                SET _STATUS_ID = (SELECT ID FROM LISTS WHERE UPPER(NAME) = 'PARTIALLY PAID' AND LIST_TYPE_ID = (SELECT ID FROM LIST_TYPES WHERE UPPER(NAME)='INVOICE_STATUS'));
        END IF;
        
        UPDATE INVOICES SET
        AMOUNT_PAID_RON = IFNULL(AMOUNT_PAID_RON, 0) + _AMOUNT_PAID_RON,
        STATUS_ID = _STATUS_ID
        WHERE ID = _ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

