--
-- Definition of procedure `INVOICESsp_delete_chain`
--

DROP PROCEDURE IF EXISTS `INVOICESsp_delete_chain`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICESsp_delete_chain`(_ID INT)
BEGIN                            
        DELETE FROM CASH_RECEIPTS WHERE INVOICE_ID = _ID;
        DELETE FROM BANK_RECEIPTS WHERE INVOICE_ID = _ID;

        UPDATE INVOICEREQUIREMENTS SET
                STATUS_ID = (SELECT ID FROM LISTS WHERE NAME='To be processed' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME='invoicerequirement_status'))
                WHERE ID IN
                        (SELECT II.INVOICEREQUIREMENT_ID FROM INVOICEREQUIREMENTS_INVOICEROWS II
                        INNER JOIN INVOICEROWS IR ON II.INVOICEROW_ID = IR.ID
                        WHERE IR.INVOICE_ID = _ID);

        -- DELETE FROM INCOME_EXPENSES WHERE INVOICE_ID = _ID;
        -- DELETE FROM COMPANY_INCOME_EXPENSES WHERE INVOICE_ID = _ID;

        UPDATE INCOME_EXPENSES SET
                STATUS_ID = (SELECT ID FROM LISTS WHERE NAME='Predicted' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME='ie_status')),
                BALLANCE = AMOUNT
                WHERE INVOICEREQUIREMENT_ID IN
                        (SELECT II.INVOICEREQUIREMENT_ID FROM INVOICEREQUIREMENTS_INVOICEROWS II
                        INNER JOIN INVOICEROWS IR ON II.INVOICEROW_ID = IR.ID
                        WHERE IR.INVOICE_ID = _ID);

        UPDATE COMPANY_INCOME_EXPENSES SET
                STATUS_ID = (SELECT ID FROM LISTS WHERE NAME='Predicted' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME='ie_status')),
                BALLANCE = AMOUNT
                WHERE INVOICEREQUIREMENT_ID IN
                        (SELECT II.INVOICEREQUIREMENT_ID FROM INVOICEREQUIREMENTS_INVOICEROWS II
                        INNER JOIN INVOICEROWS IR ON II.INVOICEROW_ID = IR.ID
                        WHERE IR.INVOICE_ID = _ID);

        DELETE FROM INVOICEREQUIREMENTS_INVOICEROWS WHERE INVOICEROW_ID IN (SELECT ID FROM INVOICEROWS WHERE INVOICE_ID = _ID);
        DELETE FROM INVOICEROWS WHERE INVOICE_ID = _ID;
        DELETE FROM INVOICES WHERE ID = _ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

