DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `INVOICESsp_get_payments`(_INVOICE_ID INT)
BEGIN
        SELECT R.ID, CONCAT('(C) ', R.SERIES,' ',LPAD(R.NUMBER,5,'0'),' / ',DATE_FORMAT(R.DATE, '%d.%m.%Y'),' - ', R.AMOUNT_PAID_RON) RECEIPT FROM CASH_RECEIPTS R WHERE INVOICE_ID = _INVOICE_ID
        UNION
        SELECT R.ID, CONCAT('(B) ', R.EXTRACT_NUMBER,' / ',DATE_FORMAT(R.EXTRACT_DATE, '%d.%m.%Y'),' - ', R.AMOUNT_PAID) RECEIPT FROM BANK_RECEIPTS R WHERE INVOICE_ID = _INVOICE_ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

