DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `LISTSsp_select_by_list_type_id`(
        _LIST_TYPE_ID INT
)
BEGIN
        DECLARE _COUNT INT;
        SET _COUNT = (SELECT COUNT(*) FROM LISTS WHERE LIST_TYPE_ID = _LIST_TYPE_ID);
        IF _COUNT IS NULL OR _COUNT = 0 THEN
                SELECT null ID, "" NAME, null LIST_TYPE_ID FROM LISTS LIMIT 1;
        ELSE
                SELECT ID, NAME, LIST_TYPE_ID FROM LISTS WHERE LIST_TYPE_ID = _LIST_TYPE_ID ORDER BY NAME;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

