--
-- Definition of procedure `OWNERSsp_get_account_field_by_bank_account`
--

DROP PROCEDURE IF EXISTS `OWNERSsp_get_account_field_by_bank_account`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `OWNERSsp_get_account_field_by_bank_account`(_BANK_ACCOUNT_SEQUENCE VARCHAR(100))
BEGIN
        DECLARE _C INT;

        IF EXISTS (SELECT BANK_ACCOUNT_DETAILS1 FROM OWNERS WHERE BANK_ACCOUNT_DETAILS1 LIKE CONCAT('%', _BANK_ACCOUNT_SEQUENCE, '%')) THEN
                BEGIN
                SET _C = 1;
                END;
        ELSE
                BEGIN
                IF EXISTS (SELECT BANK_ACCOUNT_DETAILS2 FROM OWNERS WHERE BANK_ACCOUNT_DETAILS2 LIKE CONCAT('%', _BANK_ACCOUNT_SEQUENCE, '%')) THEN
                        BEGIN
                        SET _C = 2;
                        END;
                ELSE
                        BEGIN
                        IF EXISTS (SELECT BANK_ACCOUNT_DETAILS3 FROM OWNERS WHERE BANK_ACCOUNT_DETAILS3 LIKE CONCAT('%', _BANK_ACCOUNT_SEQUENCE, '%')) THEN
                                SET _C = 3;
                        ELSE
                                SET _C = 0;
                        END IF;
                        END;
                END IF;
                END;
        END IF;

        SELECT _C FROM OWNERS LIMIT 1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

