--
-- Definition of procedure `OWNERSsp_get_by_id`
--

DROP PROCEDURE IF EXISTS `OWNERSsp_get_by_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `OWNERSsp_get_by_id`(_ID INT)
BEGIN
        SELECT O.ID, O.NAME, O.FULL_NAME,
        O.STATUS_ID, OS.NAME `STATUS`, O.TYPE_ID,  OT.NAME `TYPE`,
        O.CIF, O.CUI, O.NIF, O.CNP, O.COMMERCIAL_REGISTER_NUMBER,
        O.PASSPORT_NUMBER, O.PASSPORT_EXPIRATION_DATE,
        O.ADDRESS, O.DISTRICT, O.PHONES, O.EMAILS,
        -- O.BANK_NAME1,
        O.BANK_ID1, B1.NAME BANK_NAME1, O.BANK_ACCOUNT_DETAILS1, O.BANK_ACCOUNT_CURRENCY1, -- O.BANK_ACCOUNT_CURRENCY_ID1, IF(C1.CURRENCY IS NULL,'RON',C1.CURRENCY) BANK_ACCOUNT_CURRENCY1,
        -- O.BANK_NAME2,
        O.BANK_ID2, B2.NAME BANK_NAME2, O.BANK_ACCOUNT_DETAILS2, O.BANK_ACCOUNT_CURRENCY2, -- O.BANK_ACCOUNT_CURRENCY_ID2, IF(C2.CURRENCY IS NULL,'RON',C2.CURRENCY) BANK_ACCOUNT_CURRENCY2,
        -- O.BANK_NAME3,
        O.BANK_ID3, B3.NAME BANK_NAME3, O.BANK_ACCOUNT_DETAILS3, O.BANK_ACCOUNT_CURRENCY3, -- O.BANK_ACCOUNT_CURRENCY_ID3, IF(C3.CURRENCY IS NULL,'RON',C3.CURRENCY) BANK_ACCOUNT_CURRENCY3,
        O.RECOMMENDED_BY, O.LAWYER_INFORMATION, O.ACCOUNTANT_INFORMATION, O.ADMINISTRATOR_INFORMATION, O.OTHER_PERSONS_INFORMATION,
        O.COMMENTS, IF(CO.OWNERS IS NOT NULL, CO.OWNERS, '') CO_OWNERS,
        O.STARTING_BALLANCE1, O.STARTING_BALLANCE2, O.STARTING_BALLANCE3,
        O.CASH_STARTING_BALLANCE1, O.CASH_STARTING_BALLANCE2, O.CASH_STARTING_BALLANCE3
        LANGUAGE_ID1 , LANGUAGE_ID2 , HEADQUARTERS_CHANGED_BY_COMPANY , CLOSED_BY_COMPANY , TRANSFERRED_BY_COMPANY , POA_NIF_AND_BANK_ACCOUNTS_BY_COMPANY
        FROM OWNERS O
                LEFT JOIN LISTS OS ON O.STATUS_ID = OS.ID
                LEFT JOIN LISTS OT ON O.TYPE_ID = OT.ID
                /*
                LEFT JOIN CURRENCIES C1 ON O.BANK_ACCOUNT_CURRENCY_ID1 = C1.ID
                LEFT JOIN CURRENCIES C2 ON O.BANK_ACCOUNT_CURRENCY_ID2 = C2.ID
                LEFT JOIN CURRENCIES C3 ON O.BANK_ACCOUNT_CURRENCY_ID3 = C3.ID
                */
                LEFT JOIN (SELECT BA.ID, CONCAT(B.NAME, ' - ', BA.NAME) NAME FROM BANKS B INNER JOIN BANKSAGENCIES BA ON B.ID = BA.BANK_ID) B1 ON O.BANK_ID1 = B1.ID
                LEFT JOIN (SELECT BA.ID, CONCAT(B.NAME, ' - ', BA.NAME) NAME FROM BANKS B INNER JOIN BANKSAGENCIES BA ON B.ID = BA.BANK_ID) B2 ON O.BANK_ID2 = B2.ID
                LEFT JOIN (SELECT BA.ID, CONCAT(B.NAME, ' - ', BA.NAME) NAME FROM BANKS B INNER JOIN BANKSAGENCIES BA ON B.ID = BA.BANK_ID) B3 ON O.BANK_ID3 = B3.ID
                LEFT JOIN (SELECT COUNT(*) OWNERS, OWNER_ID FROM CO_OWNERS CO GROUP BY CO.OWNER_ID) CO ON O.ID = CO.OWNER_ID
        WHERE O.ID = _ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `OWNERSsp_get_cash_account_by_currency`
--

DROP PROCEDURE IF EXISTS `OWNERSsp_get_cash_account_by_currency`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `OWNERSsp_get_cash_account_by_currency`(_ID INT, _CURRENCY VARCHAR(5))
BEGIN
        DECLARE _C INT;
        IF EXISTS (SELECT * FROM OWNERS WHERE ID = _ID AND BANK_ACCOUNT_CURRENCY1 = _CURRENCY) THEN
                SET _C = 1;
        ELSE
                BEGIN
                IF EXISTS (SELECT * FROM OWNERS WHERE ID = _ID AND BANK_ACCOUNT_CURRENCY2 = _CURRENCY) THEN
                        SET _C = 2;
                ELSE
                        BEGIN
                        IF EXISTS (SELECT * FROM OWNERS WHERE ID = _ID AND BANK_ACCOUNT_CURRENCY3 = _CURRENCY) THEN
                                SET _C = 3;
                        ELSE
                                SET _C = 0;
                        END IF;
                        END;
                END IF;
                END;
        END IF;

        SELECT _C FROM OWNERS LIMIT 1;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

