        SELECT ID, IF(TYPE=0, 'EXPENSE', 'INCOME') TYPE, CURRENCY, AMOUNT, DATE, OWNER_ID, PROPERTY_ID, CONTRACTSERVICE_ID, SERVICE_DESCRIPTION, MONTH, INVOICEREQUIREMENT_ID, CONTRACT_SERVICE_ADDITIONAL_COST_ID, STATUS_ID
