--
-- Definition of procedure `PREDICTED_INCOME_EXPENSESsp_insert`
--

DROP PROCEDURE IF EXISTS `PREDICTED_INCOME_EXPENSESsp_insert`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PREDICTED_INCOME_EXPENSESsp_insert`(
        _TYPE BOOLEAN,
        _CURRENCY VARCHAR(4),
        _AMOUNT DOUBLE,
        _DATE DATE,
        _OWNER_ID INT,
        _PROPERTY_ID INT,
        _CONTRACTSERVICE_ID INT,
        _SERVICE_DESCRIPTION TEXT,
        _MONTH VARCHAR(45),
        _INVOICEREQUIREMENT_ID INT,
        _CONTRACT_SERVICE_ADDITIONAL_COST_ID INT,
        _STATUS_ID INT
)
BEGIN
        INSERT INTO PREDICTED_INCOME_EXPENSES SET
        TYPE = _TYPE ,
        CURRENCY = _CURRENCY ,
        AMOUNT = _AMOUNT ,
        DATE = _DATE ,
        OWNER_ID = _OWNER_ID ,
        PROPERTY_ID = _PROPERTY_ID ,
        CONTRACTSERVICE_ID = _CONTRACTSERVICE_ID ,
        SERVICE_DESCRIPTION = _SERVICE_DESCRIPTION,
        MONTH = _MONTH,
        INVOICEREQUIREMENT_ID = _INVOICEREQUIREMENT_ID,
        CONTRACT_SERVICE_ADDITIONAL_COST_ID = _CONTRACT_SERVICE_ADDITIONAL_COST_ID,
        STATUS_ID = _STATUS_ID,
        BALLANCE = _AMOUNT;

        SELECT * FROM PREDICTED_INCOME_EXPENSES WHERE ID = LAST_INSERT_ID();
END $$
