--
-- Definition of procedure `PREDICTED_INCOME_EXPENSESsp_select`
--

DROP PROCEDURE IF EXISTS `PREDICTED_INCOME_EXPENSESsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PREDICTED_INCOME_EXPENSESsp_select`()
BEGIN
        SELECT PIE.ID, IF(PIE.TYPE=0,'EXPENSE','INCOME') TYPE, PIE.CURRENCY, PIE.AMOUNT, PIE.DATE,
        PIE.OWNER_ID, O.NAME OWNER, PIE.PROPERTY_ID, P.NAME PROPERTY, PIE.CONTRACTSERVICE_ID, S.NAME SERVICE, PIE.SERVICE_DESCRIPTION,
        PIE.MONTH, PIE.INVOICEREQUIREMENT_ID, CONTRACT_SERVICE_ADDITIONAL_COST_ID, PIE.STATUS_ID, L.NAME `STATUS`,
        BALLANCE
        FROM PREDICTED_INCOME_EXPENSES PIE
        INNER JOIN OWNERS O ON PIE.OWNER_ID = O.ID
        LEFT JOIN PROPERTIES P ON PIE.PROPERTY_ID = P.ID
        INNER JOIN SERVICES S ON PIE.CONTRACTSERVICE_ID = S.ID
        INNER JOIN LISTS L ON PIE.STATUS_ID = L.ID
        WHERE PIE.DELETED != TRUE;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

