--
-- Definition of procedure `PROPERTIESsp_change_status`
--

DROP PROCEDURE IF EXISTS `PROPERTIESsp_change_status`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PROPERTIESsp_change_status`(_ID INT, _STATUS_ID INT)
BEGIN
        DECLARE _CONTRACT_PROPERTIES INT;
        UPDATE PROPERTIES SET STATUS_ID = _STATUS_ID WHERE ID = _ID;
        IF _STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Sold' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'property_status')) THEN
                BEGIN
                SET _CONTRACT_PROPERTIES = (SELECT COUNT(*) FROM CONTRACTS_PROPERTIES CP
                        INNER JOIN PROPERTIES P ON CP.PROPERTY_ID = P.ID
                        INNER JOIN LISTS L ON P.STATUS_ID = L.ID
                        WHERE PROPERTY_ID = _ID AND L.ID IN (SELECT ID FROM LISTS WHERE NAME != 'Sold' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'property_status'))
                        GROUP BY CONTRACT_ID);
                IF _CONTRACT_PROPERTIES IS NULL OR _CONTRACT_PROPERTIES <= 0 THEN
                        BEGIN
                        UPDATE CONTRACTS SET STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Finished' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'contract_status'))
                                WHERE ID IN (SELECT CONTRACT_ID FROM CONTRACTS_PROPERTIES WHERE PROPERTY_ID = _ID);

                        UPDATE PREDICTED_INCOME_EXPENSES SET DELETED = TRUE
                                WHERE PROPERTY_ID = _ID;

                        UPDATE COMPANY_PREDICTED_INCOME_EXPENSES SET DELETED = TRUE
                                WHERE EPROPERTY_ID = _ID;

                        /*
                        UPDATE INVOICEREQUIREMENTS SET STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Cancelled' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'invoicerequirement_status'))
                                WHERE PROPERTY_ID = _ID AND STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'To be processed' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'invoicerequirement_status'));
                        */
                        UPDATE INVOICEREQUIREMENTS SET DELETED = TRUE
                                WHERE PROPERTY_ID = _ID AND STATUS_ID NOT IN (SELECT ID FROM LISTS WHERE NAME = 'Invoiced' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'invoicerequirement_status'));
                        END;
                END IF;

                UPDATE RENTCONTRACTS SET STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Finished' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'rentcontract_status'))
                        WHERE PROPERTY_ID = _ID;
                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

