--
-- Definition of procedure `PROPERTIESsp_is_assigned_to_active_contract`
--

DROP PROCEDURE IF EXISTS `PROPERTIESsp_is_assigned_to_active_contract`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PROPERTIESsp_is_assigned_to_active_contract`(_PROPERTY_ID INT)
BEGIN
        SELECT COUNT(*) CNT FROM CONTRACTS C
        INNER JOIN CONTRACTS_PROPERTIES CS ON C.ID = CS.CONTRACT_ID
        INNER JOIN PROPERTIES P ON CS.PROPERTY_ID = P.ID
        INNER JOIN LISTS S ON C.EXPIRED_ID = S.ID
        WHERE C.FINISH_DATE >= NOW() AND UPPER(S.NAME) = 'ACTIVE'
        AND P.ID = _PROPERTY_ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `PROPERTIESsp_list`
--

DROP PROCEDURE IF EXISTS `PROPERTIESsp_list`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PROPERTIESsp_list`()
BEGIN
        SELECT -1 ID, "---" NAME FROM PROPERTIES LIMIT 1
        UNION
        SELECT ID, NAME
        FROM PROPERTIES
        WHERE STATUS_ID NOT IN (SELECT ID FROM LISTS WHERE NAME = 'Sold' AND LIST_TYPE_ID = (SELECT ID FROM LIST_TYPES WHERE NAME = 'property_status'))
        ORDER BY NAME;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `PROPERTIESsp_list_by_owner_id`
