/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PROPERTIESsp_list_by_owner_id`(_OWNER_ID INT)
BEGIN
        SELECT -1 ID, "---" NAME FROM PROPERTIES LIMIT 1
        UNION
        SELECT ID, NAME
        FROM PROPERTIES WHERE OWNER_ID = _OWNER_ID AND
        STATUS_ID NOT IN (SELECT ID FROM LISTS WHERE NAME = 'Sold' AND LIST_TYPE_ID = (SELECT ID FROM LIST_TYPES WHERE NAME = 'property_status'))
        ORDER BY NAME;
END $$
