--
-- Definition of procedure `PROPERTIESsp_select`
--

DROP PROCEDURE IF EXISTS `PROPERTIESsp_select`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `PROPERTIESsp_select`()
BEGIN
        SELECT P.ID, P.NAME, P.STATUS_ID, LS.NAME `STATUS`, P.PROPERTY_MANAGEMENT,
        P.OWNER_ID, O.NAME OWNER, P.POA, P.TYPE_ID, LT.NAME `TYPE`, P.PROJECT_ID,
        PJ.NAME PROJECT, P.LOCATION, P.CITY_ID,  C.NAME CITY, P.ADDRESS,
        P.ADMINISTRATOR_NAME, P.ADMINISTRATOR_PHONES, P.ADMINISTRATOR_EMAILS,
        P.PRESIDENT_OWNERS_ASSOCIATION_NAME, P.PRESIDENT_OWNERS_ASSOCIATION_PHONES,
        P.PRESIDENT_OWNERS_ASSOCIATION_EMAILS, P.OWNERS_ASSOCIATION_BANK,
        P.OWNERS_ASSOCIATION_BANK_ACCOUNT, P.MAINTENANCE_PERSON_NAME,
        P.MAINTENANCE_PERSON_PHONES, P.MAINTENANCE_PERSON_EMAILS,
        P.INTERNET_PROVIDER_INFORMATION, P.TELEPHONE_PROVIDER_INFORMATION,
        P.TV_PROVIDER_INFORMATION, 
        P.DEVELOPER_NAME, P.DEVELOPER_CONTACT_PERSON, P.DEVELOPER_PHONES,
        P.DEVELOPER_EMAILS, P.ROOMS, P.BATHROOM, P.FLOOR, P.BUILDING_FLOORS,
        P.APPARTMENT_AREA, P.TERRACE_AREA, P.TOTAL_AREA, P.COMMON_SPACES, P.TOTAL_AREA_INCLUDING_COMMON_SPACES,
        P.PARENT_PROPERTY_ID, PP.NAME PARENT_PROPERTY, P.STORAGE_ROOM,
        P.VAT_APPLICABLE, P.INDIVIDUAL_COMPLETELY_FURNISHED_PRICE,
        P.COMPANY_COMPLETELY_FURNISHED_PRICE, P.INDIVIDUAL_KITCHEN_FURNISHED_PRICED,
        P.COMPANY_KITCHEN_FURNISHED_PRICE, P.INDIVIDUAL_EMPTY_PRICE,
        P.COMPANY_EMPTY_PRICE, P.SELLING_PRICE, P.SELLING_VAT, P.SELLING_DATE, P.PURCHASED_FROM,
        P.PURCHASING_PRICE, P.PURCHASING_VAT, P.AUTHENTICATION_NUMBER, P.PURCHASE_DATE, P.NOTARY_TAXES, P.RECEIPT_NUMBER,
        P.AGENCY_COMMISSION, P.OPTIONAL_INSURANCE_COMPANY, P.APARTMENT_OPTIONAL_INSURANCE_POLICY_NUMBER,
        P.CONTENTS_OPTIONAL_INSURANCE_POLICY_NUMBER, P.OPTIONAL_INSURANCE_POLICY_EXPIRATION_DATE,
        P.MANDATORY_INSURANCE_COMPANY, P.MANDATORY_INSURANCE_POLICY_NUMBER,
        P.MANDATORY_INSURANCE_POLICY_EXPIRATION_DATE, P.CONDOMINIUM_FEE,
        P.FLOATING_CAPITAL, P.AVERAGE_APPROXIMATIVE_CONSUMPTION, P.INCLUDE_FOR_AGENCIES,
        P.SOLD_TO, P.REEVALUATION_DATE, P.REEVALUATION_VALUE, P.CENTRAL_HEATING,
        P.REGISTERED_PROPERTY, P.GAS_CONTRACT,
        P.GAS_CLIENT_CODE, P.ELECTRICITY_CONTRACT, P.ELECTRICITY_CLIENT_CODE, P.ELECTRICITY_ENELTEL_CODE,
        -- //
        P.OWNERS_ASSOCIATION_NAME, P.OWNERS_ASSOCIATION_CIF,
        P.INTERNET_PROVIDER_REPRESENTATIVE_INFORMATION,
        P.TELEPHONE_PROVIDER_REPRESENTATIVE_INFORMATION,
        P.TV_PROVIDER_REPRESENTATIVE_INFORMATION,
        P.ELECTRICITY_USER,
        P.ELECTRICITY_PASSWORD,
        P.GAS_USER ,
        P.GAS_PASSWORD ,
        P.FISCAL_ADMINISTRATION_USER ,
        P.FISCAL_ADMINISTRATION_PASSWORD ,
        P.INDIVIDUAL_SELLING_PRICE ,
        P.COMPANY_SELLING_PRICE,
        -- //
        P.SIGNED_PURCHASE_CONTRACT ,
        P.REGISTRATION_DATE  ,
        P.FURNISHED_BY_COMPANY ,
        P.GAS_CONTRACT_DONE_BY_COMPANY  ,
        P.ELECTRICITY_CONTRACT_DONE_BY_COMPANY  ,
        P.INSURANCE_DONE_BY_COMPANY,
        P.SOLD_BY_COMPANY
        
        FROM PROPERTIES P
        LEFT JOIN LISTS LS ON P.STATUS_ID = LS.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        LEFT JOIN LISTS LT ON P.TYPE_ID = LT.ID
        LEFT JOIN PROJECTS PJ ON P.PROJECT_ID = PJ.ID
        LEFT JOIN CITIES C ON P.CITY_ID = C.ID
        LEFT JOIN PROPERTIES PP ON P.PARENT_PROPERTY_ID = PP.ID
        ORDER BY P.NAME;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

