        FROM PROPERTIES P
        INNER JOIN CONTRACTS_PROPERTIES CP ON P.ID = CP.PROPERTY_ID
        LEFT JOIN LISTS LS ON P.STATUS_ID = LS.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        LEFT JOIN LISTS LT ON P.TYPE_ID = LT.ID
