--
-- Definition of procedure `RENTCONTRACTSsp_delete_chain`
--

DROP PROCEDURE IF EXISTS `RENTCONTRACTSsp_delete_chain`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `RENTCONTRACTSsp_delete_chain`(_ID INT)
BEGIN
        DECLARE _PREVIOUS_RENTCONTRACT_ID INT;
        SET _PREVIOUS_RENTCONTRACT_ID = (SELECT ID FROM RENTCONTRACTS WHERE ID = (SELECT MAX(ID) ID FROM RENTCONTRACTS WHERE NUMBER = (SELECT NUMBER FROM RENTCONTRACTS WHERE ID = _ID) AND ID < _ID));

        DELETE FROM PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE RENTCONTRACT_ID = _ID);
        DELETE FROM COMPANY_PREDICTED_INCOME_EXPENSES WHERE INVOICEREQUIREMENT_ID IN (SELECT ID FROM INVOICEREQUIREMENTS WHERE RENTCONTRACT_ID = _ID);
        DELETE FROM INVOICEREQUIREMENTS WHERE RENTCONTRACT_ID = _ID;
        DELETE FROM RENTCONTRACTS_TENANTS WHERE RENTCONTRACT_ID = _ID;
        DELETE FROM RENTCONTRACTS_CONTRACTREASONS WHERE RENTCONTRACT_ID = _ID;
        DELETE FROM RENTCONTRACTS WHERE PARENT_CONTRACT_ID = _ID;
        DELETE FROM RENTCONTRACTS WHERE ID = _ID;

        IF _PREVIOUS_RENTCONTRACT_ID IS NOT NULL THEN
                BEGIN
                DECLARE done INT DEFAULT FALSE;
                DECLARE _INVOICEREQUIREMENT_ID INT;
                DECLARE cur1 CURSOR FOR
                        SELECT IR.ID FROM RENTCONTRACTS RC
                                INNER JOIN INVOICEREQUIREMENTS IR ON RC.ID = IR.RENTCONTRACT_ID
                                WHERE RC.ID = _PREVIOUS_RENTCONTRACT_ID;
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
                OPEN cur1;
                read_loop:LOOP
                        FETCH cur1 INTO _INVOICEREQUIREMENT_ID;
                        IF done THEN
                                LEAVE read_loop;
                        END IF;
                        CALL INVOICEREQUIREMENTSsp_change_status(_INVOICEREQUIREMENT_ID, FALSE);
                END LOOP;
                CLOSE cur1;
                END;
        END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `RENTCONTRACTSsp_get_by_id`
--

DROP PROCEDURE IF EXISTS `RENTCONTRACTSsp_get_by_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `RENTCONTRACTSsp_get_by_id`(_ID INT)
BEGIN
        SELECT RC.ID, RC.NUMBER,
        RC.ADDENDUM_NUMBER, RC.ADDENDUM_DATE,
        RC.PARENT_CONTRACT_ID, PRC.NUMBER PARENT_RENTCONTRACT_NUMBER,
        -- RC.TENANT_ID, T.NAME TENANT,
        O.ID OWNER_ID, O.NAME OWNER, RC.PROPERTY_ID,
        P.NAME PROPERTY, RC.START_DATE, RC.FINISH_DATE, RC.CURRENCY, RC.STATUS_ID, LS.NAME STATUS,
        RC.RENT, RC.RENT_VAT_INCLUDED, RC.DEPOSIT,
        RC.SPLITTING, RC.PROLONGATION, RC.REAL_ESTATE_AGENCY, RC.REAL_ESTATE_AGENCY_NAME,
        RC.REGISTERED_ID, LR.NAME REGISTERED, RC.REGISTRY_NUMBER,
        RC.LODGER, RC.COMMENTS, RC.PAYMENT_LIMIT_ID, LP.NAME PAYMENT_LIMIT_DATE,
        RC.REGISTRATION_START_DATE, RC.REGISTRATION_FINISH_DATE, RC.REGISTRATION_AMOUNT
        FROM RENTCONTRACTS RC
        -- INNER JOIN TENANTS T ON RC.TENANT_ID = T.ID
        INNER JOIN PROPERTIES P ON RC.PROPERTY_ID = P.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        INNER JOIN LISTS LS ON RC.STATUS_ID = LS.ID
        LEFT JOIN LISTS LR ON RC.REGISTERED_ID = LR.ID
        LEFT JOIN LISTS LP ON RC.PAYMENT_LIMIT_ID = LP.ID
        LEFT JOIN RENTCONTRACTS PRC ON RC.PARENT_CONTRACT_ID = PRC.ID
        WHERE RC.ID = _ID;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

