--
-- Definition of procedure `RENTCONTRACTSsp_has_changes`
--

DROP PROCEDURE IF EXISTS `RENTCONTRACTSsp_has_changes`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `RENTCONTRACTSsp_has_changes`(_ID INT, _NUMBER VARCHAR(100), _ADENDUM_NUMBER VARCHAR(100))
BEGIN
        DECLARE _HAS_CHANGES INT;

        SET _HAS_CHANGES = (SELECT COUNT(*) NEXT_ADENDUMS FROM
                (SELECT DISTINCT ADDENDUM_NUMBER FROM RENTCONTRACTS WHERE NUMBER = _NUMBER AND ADDENDUM_NUMBER <> _ADENDUM_NUMBER AND ID > _ID GROUP BY NUMBER) NA);

        IF _HAS_CHANGES IS NULL OR _HAS_CHANGES <= 0 THEN
                BEGIN
                SET _HAS_CHANGES = (SELECT COUNT(*) INVOICED_REQUIREMENTS FROM
                        INVOICEREQUIREMENTS IR
                        WHERE IR.STATUS_ID = (SELECT ID FROM LISTS WHERE NAME = 'Invoiced' AND LIST_TYPE_ID IN (SELECT ID FROM LIST_TYPES WHERE NAME = 'invoicerequirement_status')) AND
                        IR.RENTCONTRACT_ID = _ID);
                END;
        END IF;

        SELECT _HAS_CHANGES;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

