        RC.REGISTERED_ID, LR.NAME REGISTERED, RC.REGISTRY_NUMBER,
        RC.LODGER, RC.COMMENTS, RC.PAYMENT_LIMIT_ID, LP.NAME PAYMENT_LIMIT_DATE,
        RC.REGISTRATION_START_DATE, RC.REGISTRATION_FINISH_DATE, RC.REGISTRATION_AMOUNT
        FROM RENTCONTRACTS RC
        -- INNER JOIN TENANTS T ON RC.TENANT_ID = T.ID
        INNER JOIN PROPERTIES P ON RC.PROPERTY_ID = P.ID
        INNER JOIN OWNERS O ON P.OWNER_ID = O.ID
        INNER JOIN LISTS LS ON RC.STATUS_ID = LS.ID
        LEFT JOIN LISTS LR ON RC.REGISTERED_ID = LR.ID
        LEFT JOIN LISTS LP ON RC.PAYMENT_LIMIT_ID = LP.ID
        LEFT JOIN RENTCONTRACTS PRC ON RC.PARENT_CONTRACT_ID = PRC.ID
        ORDER BY RC.NUMBER ASC, PRC.NUMBER DESC;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `RENTCONTRACTSsp_update`
--

DROP PROCEDURE IF EXISTS `RENTCONTRACTSsp_update`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `RENTCONTRACTSsp_update`(
        _ID INT,
        _NUMBER VARCHAR(100),
        -- _TENANT_ID INT,
        _PROPERTY_ID INT,
        _START_DATE DATE,
        _FINISH_DATE DATE,
        _STATUS_ID INT,
        _RENT DOUBLE,
        _RENT_VAT_INCLUDED DOUBLE,
        _DEPOSIT DOUBLE,
        _SPLITTING BOOL,
        _PROLONGATION BOOL,
        _REAL_ESTATE_AGENCY BOOL,
        _REAL_ESTATE_AGENCY_NAME VARCHAR(250),
        _REGISTERED_ID INT,
        _REGISTRY_NUMBER VARCHAR(100),
        _PAYMENT_LIMIT_ID INT,
        _LODGER TEXT,
        _COMMENTS TEXT,
        _PARENT_CONTRACT_ID INT,
        _ADDENDUM_NUMBER VARCHAR(100),
        _ADDENDUM_DATE DATE,
        _CURRENCY VARCHAR(4),
        _REGISTRATION_START_DATE DATE,
        _REGISTRATION_FINISH_DATE DATE,
        _REGISTRATION_AMOUNT DOUBLE
)
BEGIN
        UPDATE RENTCONTRACTS SET
        NUMBER = _NUMBER ,
        -- TENANT_ID = _TENANT_ID ,
        PROPERTY_ID = _PROPERTY_ID ,
        START_DATE = _START_DATE ,
        FINISH_DATE = _FINISH_DATE ,
        STATUS_ID = _STATUS_ID ,
        RENT = _RENT ,
        RENT_VAT_INCLUDED = _RENT_VAT_INCLUDED ,
        DEPOSIT = _DEPOSIT ,
        SPLITTING = _SPLITTING ,
        PROLONGATION = _PROLONGATION ,
        REAL_ESTATE_AGENCY = _REAL_ESTATE_AGENCY ,
        REAL_ESTATE_AGENCY_NAME = _REAL_ESTATE_AGENCY_NAME ,
        REGISTERED_ID = _REGISTERED_ID ,
        REGISTRY_NUMBER = _REGISTRY_NUMBER ,
        PAYMENT_LIMIT_ID = _PAYMENT_LIMIT_ID ,
        LODGER = _LODGER ,
        COMMENTS = _COMMENTS ,
        PARENT_CONTRACT_ID = _PARENT_CONTRACT_ID ,
        ADDENDUM_NUMBER = _ADDENDUM_NUMBER ,
        ADDENDUM_DATE = _ADDENDUM_DATE,
        CURRENCY = _CURRENCY,
        REGISTRATION_START_DATE = _REGISTRATION_START_DATE ,
        REGISTRATION_FINISH_DATE = _REGISTRATION_FINISH_DATE ,
        REGISTRATION_AMOUNT = _REGISTRATION_AMOUNT
        WHERE ID = _ID;

        UPDATE RENTCONTRACTS SET
        STATUS_ID = _STATUS_ID
        WHERE NUMBER = _NUMBER;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

