--
-- Definition of procedure `VISITROOMASSETSCONDITIONSsp_get_by_property_id`
--

DROP PROCEDURE IF EXISTS `VISITROOMASSETSCONDITIONSsp_get_by_property_id`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `VISITROOMASSETSCONDITIONSsp_get_by_property_id`(_PROPERTY_ID INT)
BEGIN
        SELECT R.ID PROPERTYROOM_ID, R.NAME ROOM_NAME, R.DETAILS ROOM_DETAILS,
        RA.ID ROOMASSET_ID, RA.NAME ASSET_NAME, RA.PRODUCER ASSET_PRODUCER, RA.NUMBER ASSET_NUMBER, RA.DETAILS ASSET_DETAILS,
        RAC.ID ROOMASSETCONDITION_ID, RAC.NAME ASSET_CONDITION,
        VAC.DETAILS ASSET_CONDITION_DETAILS
        FROM PROPERTYROOMS R
        INNER JOIN PROPERTYROOMS_ROOMASSETS RPRA ON R.ID = RPRA.PROPERTYROOM_ID
        INNER JOIN ROOMASSETS RA ON RPRA.ROOMASSET_ID = RA.ID
        INNER JOIN PROPERTIES_PROPERTYROOMS PPR ON R.ID = PPR.PROPERTYROOM_ID

        LEFT JOIN VISITSASSETSCONDITIONS VAC ON R.ID = VAC.PROPERTYROOM_ID AND RA.ID = VAC.ROOMASSET_ID
        LEFT JOIN VISITS V ON VAC.VISIT_ID = V.ID
        LEFT JOIN ROOMASSETCONDITIONS RAC ON VAC.ROOMASSETCONDITION_ID = RAC.ID

        WHERE PPR.PROPERTY_ID = _PROPERTY_ID
        ORDER BY R.NAME, RA.NAME;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

