CREATE DEFINER=`root`@`localhost` PROCEDURE `VISITSsp_select`()
BEGIN
        SELECT V.*, P.NAME PROPERTY, VR.NAME REASON, E.NAME EMPLOYEE FROM VISITS V
        INNER JOIN PROPERTIES P ON V.PROPERTY_ID = P.ID
        INNER JOIN VISITREASONS VR ON V.VISITREASON_ID = VR.ID
        INNER JOIN EMPLOYEES E ON V.EMPLOYEE_ID = E.ID
